class Dog(object):
    def _init_(self, name, age):
        self.name = name
        self.age = age

    # Now we are using self, as convention requires:
    def SayHi(self):
        print(f'Hi, my name is {self.name} and I am {self.age} years old!')

d1 = Dog('Snoopy', 4)

d1.SayHi()
